import React from 'react';
import HeaderAbout from './HeaderAbout';

const About = () => {


    return (
        <>
          <HeaderAbout/>
          <div className="about__container">
            <div className="about__image-container">

            </div>

            <div className="about__text-social--container">
              <div className="about__text-container">
              I am a front-end developer with audiovisual creation background.

              After some years working as a photographer, videographer and graphic designer I decide to reinvent myself as a front-end developer. I am passionate about constant learning, so the dynamism of the digital world is perfect for me. 

              I'm looking for my first job as a programmer. 
              </div>
              <div className="about__social-container">

              </div>
            </div>
          </div>
        </>







    )
  }

  export default About;
